    "itemNumber": "AACECO12",
    "name": "AAC ECO 12 WALNUT WATER-BASED LACQUERED SOLID WALNUT - ECO BLACK",
    "description": "With the objective of recreating HAYs iconic AAC chair from a more sustainable perspective, the About A Chair AAC 12 ECO uses recycled plastic (PP) to form the gently curved, open shell and symmetrical solid base that is consistent with the rest of the series. The lack of armrests ensures a clean, clutter-free silhouette, whilst the shaped back provides optimal comfort. The wooden frame with elegant, rounded legs conveys warmth and character, and ensures greater stability and a longer lifetime. The recycled shell is available in eco black and the base is available in solid FSC-certified oak with a water-based lacquer. The chair is EU Ecolabelled as a sign of environmental commitment, along with the other models in the ECO series – the AAC 22 ECO and AAS 32 in low and high versions.",
